import React, { Fragment } from 'react'
import {WithAuthConsumer} from '../context/AuthContext'
import { Link } from 'react-router-dom'
import logo from '../../assets/images/logo-toysland.png'

const Navbar = ({currentUser, logout}) => {
  return(
    <div className="NavbarCotainer">
      <div className="NavbarCotainerContainer">
      <Link to="/" className="logo"><img src={logo} alt=""/><p>Toy's Land</p></Link>

      {currentUser ? (
        <Fragment>
          <button className="BtnMyAccount" onClick="">Log Out</button>
          <Link to="/product" className="BtnSubirProduct">Subir Producto</Link>
        </Fragment>
      ):(
        <Fragment>
          <Link to="/account" className="BtnMyAccount">Mi Cuenta</Link>
          <Link to="/product" className="BtnSubirProduct">Subir Producto</Link> 
        </Fragment>
      )}
      </div>
    </div>
  )
}

export default WithAuthConsumer(Navbar)
